import React from "react";

function UsersTable(props) {
  return (
    <ul>
      {props.users.forEach((event) => {
        <li>
          {" "}
          {event.username} - {event.age}
        </li>;
      })}
      <li>USER - AGE</li>
    </ul>
  );
}

export default UsersTable;
